import React, { useState, useContext } from "react";
import { useNavigate } from "react-router-dom";
import { AuthContext } from "../contexts/AuthContext";

export default function Signup() {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [error, setError] = useState("");
  const [loading, setLoading] = useState(false);

  const { signup } = useContext(AuthContext);
  const nav = useNavigate();

  const submit = async (e) => {
    e.preventDefault();
    setError("");

    if (!name || !email || !password) {
      setError("Please fill all fields");
      return;
    }

    try {
      setLoading(true);
      await signup({ name, email, password });
      nav("/dashboard");
    } catch (err) {
      console.error(err);
      const msg = err?.response?.data?.message || err?.message || "Signup failed, please try again";
      setError(msg);
    } finally {
      setLoading(false);
    }
  };

  const goLogin = () => nav('/login');

  return (
    <div className="min-h-screen flex items-center justify-center" style={{background: '#f3f6ff'}}>
      <div className="w-full max-w-md mx-4 p-8 rounded-2xl shadow-xl bg-white" style={{textAlign:'center'}}>
        <div style={{display:'flex', flexDirection:'column', alignItems:'center', gap:12}}>
          <div style={{width:72, height:72, borderRadius:9999, background:'#eef2ff', display:'flex', alignItems:'center', justifyContent:'center'}}>
            <span style={{fontSize:32}}>ðŸ’¼</span>
          </div>
          <h1 style={{margin:0, fontSize:26, fontWeight:700, color:'#0b1220'}}>Create your account</h1>
          <p style={{margin:0, color:'#475569'}}>Join Finarth to manage your finances</p>
        </div>

        {error && <div className="mb-3 text-sm text-red-600 bg-red-50 p-2 rounded" style={{marginTop:16}}>{error}</div>}

        <form onSubmit={submit} className="space-y-3" style={{marginTop:18, textAlign:'left'}}>
          <label style={{display:'block', fontSize:12, color:'#374151', marginBottom:6}}>Full name</label>
          <input
            value={name}
            onChange={(e) => setName(e.target.value)}
            placeholder="Full name"
            className="w-full p-3 rounded border"
            autoComplete="name"
            required
          />

          <label style={{display:'block', fontSize:12, color:'#374151', marginTop:8, marginBottom:6}}>Email</label>
          <input
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            placeholder="you@example.com"
            type="email"
            className="w-full p-3 rounded border"
            autoComplete="email"
            required
          />

          <label style={{display:'block', fontSize:12, color:'#374151', marginTop:8, marginBottom:6}}>Password</label>
          <input
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            type="password"
            placeholder="Create a password"
            className="w-full p-3 rounded border"
            autoComplete="new-password"
            required
          />

          <button
            disabled={loading}
            className="w-full p-3 rounded-2xl bg-indigo-600 text-white disabled:opacity-60"
          >
            {loading ? "Creating account..." : "Create account"}
          </button>
        </form>

        <div className="mt-4 text-center">
          <p className="text-sm text-gray-600">Already have an account?</p>
          <button onClick={goLogin} className="mt-2 inline-block text-sm font-medium text-indigo-700 hover:underline">Sign in</button>
        </div>
      </div>
    </div>
  );
}
